    var changedHandler = function(e){
        if(e.target && e.target.value){
            val = e.target.value;
            span.innerHTML = e.target.value; 
            if(intervalID && isPlay){
                window.clearInterval(intervalID) ;
                btn.value = "start";
                isPlay = false;
            }
                 
        }
    };
    
    var loadHandler = function(e){
            var w = 107 , h = 155 , sy , sx;            
        for(var i = 0 ; i < 16 ; i++){
            sx = (i%8) * w ;
            sy = Math.floor(i / 8);
             //context.drawImage(image, sx, sy, sw, sh, dx, dy, dw, dh)
            context.drawImage(img, sx , sy ,w , h ,0,0,107,155);            
            imgDatas[i] = context.getImageData(0, 0,canvas.width,canvas.height);           
            //var imgData = context.createImageData(canvas.width,canvas.height);
            //context.putImageData(imgData,0,0);
            context.clearRect(0, 0, canvas.width, canvas.height); 
        }
        //console.log(imgDatas.length);
        reanderFish();
        
       // 
    };
    
    var clickHandler = function(e){
        if(isPlay){
            window.clearInterval(intervalID);
            isPlay = false;
            btn.value = "start";
        }else{
            intervalID = window.setInterval(reanderFish, 1000/parseInt(val,10));
            isPlay = true;
            btn.value = "stop";
        }      
    };
    
    var reanderFish = function(){
        console.log(frame);
        context.putImageData(imgDatas[frame], 0, 0);
        frame++;
        frame%=16;
        
    };

  
    init();
}());
